import React from 'react'
import './Navbar.css';
import logo from '../../Assets/Brown Mountain Travel Retro Logo-Photoroom.png';


const Navbar = () => {
  return (
    <>
    <nav id="navbar">
        <img src={logo} id='logo' />
        <div id='nav-links'>
            <a href=''>Home</a>
            <a href=''>Discover</a>
            <a href=''>Plan A Trip</a>
        </div>
    </nav>
    </>
  )
}

export default Navbar
